import React from 'react';
import NavBar from './components/NavBar';
import FormOptimizacion from './components/OptimizacionLineal';
import './css/optimizacion.css';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCode } from '@fortawesome/free-solid-svg-icons'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">
      <NavBar />
      <div className = 'container'>
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h1 className="display-4"><FontAwesomeIcon icon={faCode} /> Optimización lineal</h1>
            <p className="lead">Optimización de la producción semanal de helados.</p>
            <OptimizacionLineal />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
